                var v1 = new decvec3(-7.5m, -3m, -7m);
                var v2 = v0.gbk;
                v0.gbk = v1;
                var v3 = v0.gbk;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(2.5m, v0.x);
                Assert.AreEqual(-7.5m, v0.y);
                Assert.AreEqual(-3m, v0.z);
                Assert.AreEqual(-9m, v0.w);
                Assert.AreEqual(-7m, v0.v);
            
                Assert.AreEqual(2m, v2.x);
                Assert.AreEqual(6.5m, v2.y);
                Assert.AreEqual(8m, v2.z);
            }
            {
                var v0 = new decvec5(9.5m, 1m, -7m, -1m, -7m);
                var v1 = new decvec4(-2m, -8.5m, -4m, -9.5m);
                var v2 = v0.rgbk;
                v0.rgbk = v1;
                var v3 = v0.rgbk;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(-2m, v0.x);
                Assert.AreEqual(-8.5m, v0.y);
                Assert.AreEqual(-4m, v0.z);
                Assert.AreEqual(-1m, v0.w);
                Assert.AreEqual(-9.5m, v0.v);
            
                Assert.AreEqual(9.5m, v2.x);
                Assert.AreEqual(1m, v2.y);
                Assert.AreEqual(-7m, v2.z);
                Assert.AreEqual(-7m, v2.w);
            }
            {
                var v0 = new decvec5(-2.5m, -4m, -1m, 5.5m, 6.5m);
                var v1 = new decvec2(-4.5m, 2m);
                var v2 = v0.ak;
                v0.ak = v1;
                var v3 = v0.ak;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(-2.5m, v0.x);
                Assert.AreEqual(-4m, v0.y);
                Assert.AreEqual(-1m, v0.z);
                Assert.AreEqual(-4.5m, v0.w);
                Assert.AreEqual(2m, v0.v);
            
                Assert.AreEqual(5.5m, v2.x);
                Assert.AreEqual(6.5m, v2.y);
            }
            {
                var v0 = new decvec5(2.5m, -3.5m, -4m, -2m, 6.5m);
                var v1 = new decvec3(-0.5m, 5.5m, 1m);
                var v2 = v0.rak;
                v0.rak = v1;
                var v3 = v0.rak;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(-0.5m, v0.x);
                Assert.AreEqual(-3.5m, v0.y);
                Assert.AreEqual(-4m, v0.z);
                Assert.AreEqual(5.5m, v0.w);
                Assert.AreEqual(1m, v0.v);
            
                Assert.AreEqual(2.5m, v2.x);
                Assert.AreEqual(-2m, v2.y);
                Assert.AreEqual(6.5m, v2.z);
            }
            {
                var v0 = new decvec5(-7m, 3.5m, -2m, 9m, 1m);
                var v1 = new decvec3(-3m, 0m, 1m);
                var v2 = v0.gak;
                v0.gak = v1;
                var v3 = v0.gak;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(-7m, v0.x);
                Assert.AreEqual(-3m, v0.y);
                Assert.AreEqual(-2m, v0.z);
                Assert.AreEqual(0m, v0.w);
                Assert.AreEqual(1m, v0.v);
            
                Assert.AreEqual(3.5m, v2.x);
                Assert.AreEqual(9m, v2.y);
                Assert.AreEqual(1m, v2.z);
            }
            {
                var v0 = new decvec5(5.5m, -4m, -1.5m, -6m, 0m);
                var v1 = new decvec4(3m, 2.5m, 8m, 9.5m);
                var v2 = v0.rgak;
                v0.rgak = v1;
                var v3 = v0.rgak;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(3m, v0.x);
                Assert.AreEqual(2.5m, v0.y);
                Assert.AreEqual(-1.5m, v0.z);
                Assert.AreEqual(8m, v0.w);
                Assert.AreEqual(9.5m, v0.v);
            
                Assert.AreEqual(5.5m, v2.x);
                Assert.AreEqual(-4m, v2.y);
                Assert.AreEqual(-6m, v2.z);
                Assert.AreEqual(0m, v2.w);
            }
            {
                var v0 = new decvec5(0.5m, -4m, 2.5m, 3.5m, -5m);
                var v1 = new decvec3(0m, 5.5m, -7m);
                var v2 = v0.bak;
                v0.bak = v1;
                var v3 = v0.bak;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(0.5m, v0.x);
                Assert.AreEqual(-4m, v0.y);
                Assert.AreEqual(0m, v0.z);
                Assert.AreEqual(5.5m, v0.w);
                Assert.AreEqual(-7m, v0.v);
            
                Assert.AreEqual(2.5m, v2.x);
                Assert.AreEqual(3.5m, v2.y);
                Assert.AreEqual(-5m, v2.z);
            }
            {
                var v0 = new decvec5(3.5m, -2.5m, -6.5m, 8m, 1m);
                var v1 = new decvec4(-9.5m, 9m, 5m, -5m);
                var v2 = v0.rbak;
                v0.rbak = v1;
