                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(-9.5m, v0.x);
                Assert.AreEqual(-2.5m, v0.y);
                Assert.AreEqual(9m, v0.z);
                Assert.AreEqual(5m, v0.w);
                Assert.AreEqual(-5m, v0.v);
            
                Assert.AreEqual(3.5m, v2.x);
                Assert.AreEqual(-6.5m, v2.y);
                Assert.AreEqual(8m, v2.z);
                Assert.AreEqual(1m, v2.w);
            }
            {
                var v0 = new decvec5(4.5m, -6.5m, 9.5m, -2m, -3m);
                var v1 = new decvec4(6m, -2.5m, -2m, -5m);
                var v2 = v0.gbak;
                v0.gbak = v1;
                var v3 = v0.gbak;
            
                Assert.AreEqual(v1, v3);
            
                Assert.AreEqual(4.5m, v0.x);
                Assert.AreEqual(6m, v0.y);
                Assert.AreEqual(-2.5m, v0.z);
                Assert.AreEqual(-2m, v0.w);
                Assert.AreEqual(-5m, v0.v);
            
                Assert.AreEqual(-6.5m, v2.x);
                Assert.AreEqual(9.5m, v2.y);
                Assert.AreEqual(-2m, v2.z);
                Assert.AreEqual(-3m, v2.w);
            }
            {
                var v0 = new decvec5(-7.5m, 8m, 8m, 1m, -1.5m);
